import React from "react";
import styled from "styled-components";
export default function Navbar() {
  return (
    <div>
      <Nav>
        <Logo>
            <img src="/Images/HospitalLogo.png" alt="MyHospitalWebsite" />
        </Logo>
      </Nav>
    </div>
  );
}

const Nav = styled.nav`
  border: 2px solid green;
  position: fixed;
  top: 0%;
  left: 0%;
`;

const Logo=styled.a`
  width: 200px;
`
